Privacy & Cookie Statement
Privacy Statement
This Privacy Notice is issued by the National Transport Authority of Dún Scéine, Iveagh Court, Harcourt Lane, Dublin 2 (“NTA”, “we”, “us”, “our”).
The purpose of this notice is to inform you of the data relating to you that we collect and use in connection with this website and the uses (including disclosures to third parties) we make of such data. The NTA is not responsible for the content or privacy practices of any linked sites.
If you have any questions about our use of your personal data, please contact us at info@nationaltransport.ie or you can contact our Data Protection Officer at privacy@nationaltransport.ie .
Personal Data that we Collect and Process
We collect and process personal data relating to you in connection with your use of this website and our relationship with you. This personal data may include:

your name and contact details, including your address, phone number and email address;
information that you provide in any online application form, including Freedom of Information requests;
information that you submit during a consultation process with us;
information that you provide by email or letter;
any other personal data relating to you that you provide to us or that we generate about you in connection with your use of the Transport for Ireland website, the Journey Planner website, the Journey Planner app, the Real Time app, the Cycle Planner app and the Driver Check app .

Website Usage Data
We use a monitoring application to collate and analyse certain statistical information about the use of this website. When you visit our website, the following information is retained about that visit:

IP (Internet Protocol) address;
the number of times per visit a request for data was received from each IP address;
the entry page to our website;
the length of time spent on our website;
the exit page from our website;
the IP address of a link if used to access our website;
the identity of any search engine used to access our website;
a list of all the pages visited while in our website; and
the name of the browser used, e.g. Firefox, Chrome, Internet Explorer.

No attempt is made to identify individual users or to associate the technical details listed above with any individual.
Purposes of Processing and Legal Basis
We will use personal data relating to you for the purposes of:

improving and developing this website and our apps;
processing application forms, including for Freedom of Information requests;
engaging in a consultation process;
carrying out research and customer satisfaction surveys;
responding to queries and feedback submitted by you;
sending you promotional and marketing materials, subject to any preferences that you express when we collect your contact details or subsequently. You can opt out of receiving promotional and marketing materials from us at any time by contacting info@nationaltransport.ie;
generating and analysing statistics regarding usage of this website, including the frequency of use of individual pages (where possible, personal data will be anonymised before being used for this purpose);
fraud prevention, investigation and detection;
establishing, exercising or defending legal claims;
performing our functions as a public authority and complying with our legal obligations.

The legal bases on which we process your personal data are:

that this is necessary for the performance of tasks that we carry out in the public interest or in the exercise of official authority vested in us by law;
that this is necessary for compliance with a legal obligation that applies to us; or
that you have given your consent to the processing.

Recipients of Data
We may disclose your personal data to other organisations in connection with the above purposes, including:

to public service transport operators;
to third parties who we engage to provide services to us in connection with this website, such as outsourced service providers, IT services providers, professional advisers and auditors;
to other public authorities and bodies where required or permitted by law, such as the Gardaí or other law enforcement authorities for the purposes of the prevention, investigation or detection of crime.

Retention
We will not hold your personal data for longer than is necessary. We retain your personal data for as long as we need it for the purposes described in this Notice, or to comply with our obligations under applicable law and, if relevant, to deal with any claim or dispute that might arise between you and us. Feedback, queries, complaints and other correspondence submitted on our website or by email are retained for 7 years. The retention period for Freedom of Information requests, responses and feedback is indefinite.
Your rights
You have the following rights, in certain circumstances and subject to certain restrictions, in relation to your personal data:

the right to access your personal data;
the right to request the rectification and/or erasure of your personal data;
the right to restrict the use of your personal data;
the right to object to the processing of your personal data;
the right to receive your personal data, which you provided to us, in a structured, commonly used and machine-readable format or to require us to transmit that data to another controller; and
where our processing of your personal data is based on you having provided consent, the right to withdraw your consent to the processing at any time by emailing info@nationaltransport.ie

If you wish to exercise any of the rights set out above, please contact us at privacy@nationaltransport.ie
