Managing Cookies
It is usually possible to stop your browser accepting Cookies, or to stop it accepting Cookies from a particular website. However, if you disable all Cookies we cannot tell if you are signed in and some features of our Sites may not work correctly and you may have to manually adjust some preferences every time you visit.
All modern browsers allow you to change your cookie settings. You can usually find these settings in the Options or Preferences menu of your browser. To understand these settings, the following links may be helpful, or you can use the Help option in your browser for more details.
Cookie settings in Internet Explorer
Cookie settings in Firefox
Cookie settings in Chrome
Cookie settings in Safari web and Safari for iOS.
If you wish to check and manage third party advertising cookies, you can turn these off by going to the Your Online Choices site.
Updates
We may occasionally update this policy. We encourage you to periodically review this policy for the latest information on our privacy practices.
Complaints
If you are not happy with the way we are using your personal data or how we facilitate your rights or comply with our obligations under applicable data protection law, you have the right to make a complaint to the Data Protection Commissioner by emailing info@dataprotection.ie.
 
